import React from "react";
import ".././output.css";

function HeaderText(props) {
  return (
    // ✅ Add return here
    <div className={`text-${props.position}`}>
      <div className="w-[273.28px] h-[45px] text-center text-white text-4xl font-bold font-['Outfit'] leading-10">
        {props.line1}
      </div>
      {props.line2 && (
        <div className="w-[273.28px] h-[45px] text-center text-white text-4xl font-bold font-['Outfit'] leading-10">
          {props.line2}
        </div>
      )}
    </div>
  );
}

export default HeaderText;
